import React, { useState } from "react";
import Login from "./Login";
import Register from "./Register";
import Licitatii from "./Licitatii";

const App=()=>{
    const [currentForm, setCurrentForm] = useState('login');
    const [liciForm, setLiciForm] = useState('login');

    const toggleForm = (formName) => {
        setCurrentForm(formName);
    }

    const licitatieForm = (formName) =>{
        setLiciForm(formName);
    }

    return (
        <div className="App">
            {
               // currentForm === "login" ? <Login onFormSwitch={toggleForm} /> : <Register onFormSwitch={toggleForm} />
                currentForm === "login" ? <Login onFormSwitch={licitatieForm()} /> : <Licitatii onFormSwitch={licitatieForm()} />
            }
        </div>
    );
}

export default App
